import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import SignUp from '/Users/v450/myphysiotherapist/src/components/SignUp.js'; // Changed to relative path
import Login from '/Users/v450/myphysiotherapist/src/components/LogIn.js'; // Changed to relative path
import Logout from '/Users/v450/myphysiotherapist/src/components/LogOut.js'; // Changed to relative path
import Dashboard from './components/Dashboard'; // Changed to relative path
import ProtectedRoute from './auth/ProtectedRoute';
import History from '/Users/v450/myphysiotherapist/src/components/History.js'; // Changed to relative path
import axios from 'axios';

const MY_API = process.env.REACT_APP_MY_API; // Changed to use the REACT_APP_ prefix

function App() {
  const [therapyHistory, setTherapyHistory] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(''); // Added state for error handling

  useEffect(() => {
    const fetchTherapyHistory = async () => {
      setLoading(true);
      try {
        const response = await axios.get(MY_API);
        setTherapyHistory(response.data);
      } catch (error) {
        console.error('Error fetching therapy history:', error);
        setError('Failed to fetch history. Please try again later.'); // Set error message
      }
      setLoading(false);
    };

    fetchTherapyHistory();
  }, []);

  return (
    <Router>
      <h1>Welcome to My Physiotherapist</h1>
      <p>My Physiotherapist is an app that guides you through the basic rehabilitation process.
        You can save your exercise data and track your pain intensity over time.</p>

      <div>
        <nav>
          <ul>
            <li><Link to="/signup">Sign Up</Link></li>
            <li><Link to="/login">Login</Link></li>
            <li><Link to="/logout">Logout</Link></li>
            <li><Link to="/history">History</Link></li>
          </ul>
        </nav>

        <Routes>
          <Route path="/signup" element={<SignUp />} />
          <Route path="/login" element={<Login />} />
          <Route path="/logout" element={<Logout />} />
          <Route path="/history" element={<History history={therapyHistory} loading={loading} error={error} />} />
          <Route 
            path="/dashboard" 
            element={
              <ProtectedRoute>
                <Dashboard />
              </ProtectedRoute>
            } 
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
